window.bookSummaryJSON = "<p>After the end of the <i>Enterprise</i>â„¢'s five-year mission, Captain Kirk, Mr. Spock, and Dr. McCoy struggle to establish new lives apart from one another and the starship. The newly promoted Admiral Kirk is placed in charge of a specially created Starfleet division and attempts to defuse a critical hostage situation; Mr. Spock, who, in the midst of a teaching assignment on Vulcan, finds the one thing he least expected; and Dr. McCoy, whose unerring instinct for trouble lands him smack in the middle of an incident that could trigger an interstellar bloodbath.</p>"; 
